export const playerStats = {
  level: 50,
  maxHealth: respone.data.stats[0].base_stat,
  name: pokemon.name,
  img: respone.data.sprites.front_default,

  magic: pokemon.attack,
  attack: pokemon.attack,
  defense: pokemon.defense,
  magicDefense: respone.data.stats[2].base_stat,
};

export const opponentStats = {
  level: 50,
  name: 'opponent',
  maxHealth: 188,
  img: '/assets/samus.png',

  magic: 50,
  attack: 32,
  defense: 20,
  magicDefense: 48,
};
